import React from "react"
import { useQuery, useMutation } from "react-query"
import { BranchService } from "../services"

const useBranchByAdmin = () => {
  const [getBranch, { status, error, data }] = useMutation(BranchService.getBranchByAdmin)

  return {
    getBranch,
    status,
    error,
    data,
  }
}

